const formatLinks = menu => {
  return menu.map(menuSection => {
    const formattedLinks = menuSection.links.map(link => ({
      ...link,
      isDisplayed: false,
    }));

    return { ...menuSection, links: formattedLinks };
  });
};

export default formatLinks;
